import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const indexPage = () => (
  <div>
    <h1>The Main Page</h1>
    <p>
      Go To{' '}
      <Link href="/auth">
        <a>Auth</a>
      </Link>
    </p>
    <button onClick={() => Router.push('/auth')}>Go to Auth</button>
    <style jsx>{`
      div {
        border: 1px solid #eee;
        box-shadow: 0 2px 3px #ccc;
        padding: 20px;
        text-align: center;
      }
    `}</style>
  </div>
);

export default indexPage;
